import React, { useEffect, useState } from 'react';
import { fetchRevenueByCountry } from '../api';

function ResultsTable() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchRevenueByCountry()
      .then((res) => {
        // Ajusta según la estructura real de la respuesta
        setData(res.data || res.result || []);
        setLoading(false);
      })
      .catch((err) => {
        setError(err.message);
        setLoading(false);
      });
  }, []);

  return (
    <section>
      <h2>Resultados Detallados</h2>
      {loading ? (
        <p>Cargando...</p>
      ) : error ? (
        <p style={{color: 'red'}}>Error: {error}</p>
      ) : (
        <table>
          <thead>
            <tr>
              <th>Consulta</th>
              <th>PostgreSQL (ms)</th>
              <th>MonetDB (ms)</th>
              <th>CPU (%)</th>
              <th>Memoria (MB)</th>
            </tr>
          </thead>
          <tbody>
            {data.length === 0 ? (
              <tr><td colSpan={5}>No hay datos</td></tr>
            ) : (
              data.map((row, idx) => (
                <tr key={idx}>
                  <td>{row.query || row.name || `Consulta ${idx+1}`}</td>
                  <td>{row.pg_ms ?? '-'}</td>
                  <td>{row.monet_ms ?? '-'}</td>
                  <td>{row.cpu ?? '-'}</td>
                  <td>{row.memory ?? '-'}</td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      )}
    </section>
  );
}

export default ResultsTable;
